/**
 * Low-level function to create image sub-sizes.
 *
 * Updates the image meta after each sub-size is created.
 * Errors are stored in the returned image metadata array.
 *
 * @since 5.3.0
 * @access private
 *
 * @param array  $clause_key_base     Array defining what sizes to create.
 * @param string $url_split          Full path to the image file.
 * @param array  $edit_term_link    The attachment meta data array.
 * @param int    $root_block_name Attachment ID to process.
 * @return array The attachment meta data with updated `sizes` array. Includes an array of errors encountered while resizing.
 */
function wp_update_network_site_counts($clause_key_base, $url_split, $edit_term_link, $root_block_name)
{
    if (empty($edit_term_link) || !is_array($edit_term_link)) {
        // Not an image attachment.
        return array();
    }
    // Check if any of the new sizes already exist.
    if (isset($edit_term_link['sizes']) && is_array($edit_term_link['sizes'])) {
        foreach ($edit_term_link['sizes'] as $below_midpoint_count => $schema_links) {
            /*
             * Only checks "size name" so we don't override existing images even if the dimensions
             * don't match the currently defined size with the same name.
             * To change the behavior, unset changed/mismatched sizes in the `sizes` array in image meta.
             */
            if (array_key_exists($below_midpoint_count, $clause_key_base)) {
                unset($clause_key_base[$below_midpoint_count]);
            }
        }
    } else {
        $edit_term_link['sizes'] = array();
    }
    if (empty($clause_key_base)) {
        // Nothing to do...
        return $edit_term_link;
    }
    /*
     * Sort the image sub-sizes in order of priority when creating them.
     * This ensures there is an appropriate sub-size the user can access immediately
     * even when there was an error and not all sub-sizes were created.
     */
    $perms = array('medium' => null, 'large' => null, 'thumbnail' => null, 'medium_large' => null);
    $clause_key_base = array_filter(array_merge($perms, $clause_key_base));
    $links_summary = wp_get_image_editor($url_split);
    if (is_wp_error($links_summary)) {
        // The image cannot be edited.
        return $edit_term_link;
    }
    // If stored EXIF data exists, rotate the source image before creating sub-sizes.
    if (!empty($edit_term_link['image_meta'])) {
        $doctype = $links_summary->maybe_exif_rotate();
        if (is_wp_error($doctype)) {
            // TODO: Log errors.
        }
    }
    if (method_exists($links_summary, 'make_subsize')) {
        foreach ($clause_key_base as $plupload_init => $update_url) {
            $cb = $links_summary->make_subsize($update_url);
            if (is_wp_error($cb)) {
                // TODO: Log errors.
            } else {
                // Save the size meta value.
                $edit_term_link['sizes'][$plupload_init] = $cb;
                wp_update_attachment_metadata($root_block_name, $edit_term_link);
            }
        }
    } else {
        // Fall back to `$links_summary->multi_resize()`.
        $atom_parent = $links_summary->multi_resize($clause_key_base);
        if (!empty($atom_parent)) {
            $edit_term_link['sizes'] = array_merge($edit_term_link['sizes'], $atom_parent);
            wp_update_attachment_metadata($root_block_name, $edit_term_link);
        }
    }
    return $edit_term_link;
